import React, { useContext, useState } from "react";
import axios from "axios";

const BASE_URL = "http://localhost:5000/";

const GlobalContext = React.createContext();

export const GlobalProvider = ({ children }) => {
    const [incomes, setIncomes] = useState([]);
    const [expense, setExpenses] = useState([]);
    const [error, setError] = useState(null);

    const getToken = () => localStorage.getItem("token");

    // -------------------- Income --------------------

    const addIncome = async (income) => {
        const token = getToken();
        if (!token) return setError("User not authenticated");

        try {
            const response = await axios.post(`${BASE_URL}add-income`, income, {
                headers: {
                    Authorization: `Bearer ${token}`,
                    "Content-Type": "application/json",
                },
            });
            console.log("Add income response:", response.data);
            getIncomes();
        } catch (err) {
            handleRequestError(err);
        }
    };

    const getIncomes = async () => {
        const token = getToken();
        if (!token) return setError("User not authenticated");

        try {
            const response = await axios.get(`${BASE_URL}get-income`, {
                headers: {
                    Authorization: `Bearer ${token}`,
                },
            });
            console.log("Get incomes response:", response.data);
            setIncomes(response.data);
        } catch (err) {
            handleRequestError(err);
        }
    };

    const deleteIncome = async (id) => {
        const token = getToken();
        if (!token) return setError("User not authenticated");

        try {
            const response = await axios.delete(`${BASE_URL}delete-income/${id}`, {
                headers: {
                    Authorization: `Bearer ${token}`,
                },
            });
            console.log("Delete income response:", response.data);
            getIncomes();
        } catch (err) {
            handleRequestError(err);
        }
    };

    const totalIncome = () => {
        return incomes.reduce((acc, income) => acc + income.amount, 0);
    };

    // -------------------- Expense --------------------

    const addExpense = async (expense) => {
        const token = getToken();
        if (!token) return setError("User not authenticated");

        try {
            const response = await axios.post(`${BASE_URL}add-expense`, expense, {
                headers: {
                    Authorization: `Bearer ${token}`,
                    "Content-Type": "application/json",
                },
            });
            console.log("Add expense response:", response.data);
            getExpenses();
        } catch (err) {
            handleRequestError(err);
        }
    };

    const getExpenses = async () => {
        const token = getToken();
        if (!token) return setError("User not authenticated");

        try {
            const response = await axios.get(`${BASE_URL}get-expense`, {
                headers: {
                    Authorization: `Bearer ${token}`,
                },
            });
            console.log("Get expenses response:", response.data);
            setExpenses(response.data);
        } catch (err) {
            handleRequestError(err);
        }
    };

    const deleteExpense = async (id) => {
        const token = getToken();
        if (!token) return setError("User not authenticated");

        try {
            const response = await axios.delete(`${BASE_URL}delete-expense/${id}`, {
                headers: {
                    Authorization: `Bearer ${token}`,
                },
            });
            console.log("Delete expense response:", response.data);
            getExpenses();
        } catch (err) {
            handleRequestError(err);
        }
    };

    const totalExpense = () => {
        return expense.reduce((acc, exp) => acc + exp.amount, 0);
    };

    const totalBalance = () => {
        return totalIncome() - totalExpense();
    };

    // -------------------- History --------------------

    const transactionHistory = () => {
        const history = [...incomes, ...expense];
        history.sort((a, b) => new Date(b.createdAt) - new Date(a.createdAt));
        return history.slice(0, 3);
    };

    const ViewHistory = () => {
        const view = [...incomes, ...expense];
        view.sort((a, b) => new Date(b.createdAt) - new Date(a.createdAt));
        return view;
    };

    // -------------------- Error Handler --------------------

    const handleRequestError = (err) => {
        console.error("Request error:", err);
        if (err.response && err.response.data) {
            console.error("Server response:", err.response.data);
            setError(err.response.data.message || "Server error occurred");
        } else if (err.request) {
            console.error("No response received:", err.request);
            setError("No response from server");
        } else {
            console.error("Setup error:", err.message);
            setError("Error setting up request: " + err.message);
        }
    };

    return (
        <GlobalContext.Provider
            value={{
                addIncome,
                getIncomes,
                incomes,
                deleteIncome,
                expense,
                totalIncome,
                addExpense,
                getExpenses,
                deleteExpense,
                totalExpense,
                totalBalance,
                transactionHistory,
                error,
                setError,
                ViewHistory,
            }}
        >
            {children}
        </GlobalContext.Provider>
    );
};

export const useGlobalContext = () => useContext(GlobalContext);
